CREATE DEFINER=`root`@`localhost` PROCEDURE `append_boat_port`(
        IN in_id_operator INTEGER(11),
        IN in_local_operator_id INTEGER(11),
        IN in_id_place INTEGER(11),
        IN in_level_place INTEGER(11),
        IN in_id_type INTEGER(11)
    )
BEGIN
set in_id_place = (SELECT `t_operator_place_mapper`.`id_place`
	  from `t_operator_place_mapper`
	  where `t_operator_place_mapper`.`id_operator` = in_id_operator
		  and `t_operator_place_mapper`.`id_level` = in_level_place
	      and `t_operator_place_mapper`.`local_operator_id` = in_id_place
    	  and `t_operator_place_mapper`.`is_exist` = 1);
while in_level_place is not null do
	INSERT INTO 
	  `t_boat_ports`
	(
	  `id_operator`,
	  `local_operator_id_boat`,
	  `id_place`,
	  `level_place`,
	  `type`
	) 
	VALUE (
	  in_id_operator,
	  in_local_operator_id,
	  in_id_place,
	  in_level_place,
	  in_id_type
	) on DUPLICATE key UPDATE id=id;
    
    set in_level_place = null;
    
    select ppar.`id`, ppar.`id_level` into in_id_place, in_level_place
    from `t_places` pch join `t_places` ppar on pch.`id_parent` = ppar.`id`
    where pch.`id` = in_id_place;
    
end while;
END ;;
