CREATE DEFINER=`root`@`localhost` PROCEDURE `append_place`(
        IN in_id_operator INTEGER(11),
        IN in_id_level INTEGER(11),
        IN in_local_operator_id INTEGER(11),
        IN in_name VARCHAR(127),
        IN in_local_operator_parent_id INTEGER(11),
        IN in_local_operator_parent_level INTEGER(11),
        IN in_code VARCHAR(20),
        IN in_lat DECIMAL(11, 6),
        IN in_lon DECIMAL(11, 6)
    )
BEGIN

DECLARE int_place_id INTEGER;

INSERT INTO 
  `t_places`
(
  `id_level`,
  `id_parent`,
  `name`,
  `code`,
  `lat`,
  `lon`
) 
VALUE (
  in_id_level,
  if(in_local_operator_parent_id=0, 0, (select `t_operator_place_mapper`.`id_place` 
   from `t_operator_place_mapper`
   where `t_operator_place_mapper`.`id_operator` = in_id_operator and
   `t_operator_place_mapper`.`local_operator_id` = in_local_operator_parent_id and
   `t_operator_place_mapper`.`id_level` = in_local_operator_parent_level)),
  in_name,
  in_code,
  in_lat,
  in_lon
) on DUPLICATE KEY UPDATE id=LAST_INSERT_ID(id);

SET int_place_id = LAST_INSERT_ID();

INSERT INTO 
  `t_operator_place_mapper`
(
  `id_place`,
  `id_operator`,
  `id_level`,
  `local_operator_id`,
  `is_exist`
) 
VALUE (
  int_place_id,
  in_id_operator,
  in_id_level,
  in_local_operator_id,
  1
) on DUPLICATE key UPDATE is_exist = 1;

END ;;
