CREATE DEFINER=`root`@`localhost` PROCEDURE `site_cancel_booking`(
        IN in_id_user INTEGER(11),
        IN in_id_booking INTEGER(11)
    )
BEGIN

if (select COUNT(*) from `t_book_request` where `t_book_request`.`id_user` = in_id_user
	and `t_book_request`.`id` = in_id_booking) then

INSERT INTO 
  `t_book_request_history`
(
  `id_booking`,
  `id_user`,
  `id_operator`,
  `id_yacht_operator_local`,
  `date_from`,
  `date_to`,
  `when_request`,
  `id_status`,
  `id_operator_booking`
) 
Select
  id,
  id_user,
  id_operator,
  id_yacht_operator_local,
  date_from,
  date_to,
  now(),
  3,
  id_operator_booking
from `t_book_request`;

delete from `t_book_request`
where `t_book_request`.`id` = in_id_booking;

select 0;

else 

select -1;

end if;

END ;;
