CREATE DEFINER=`root`@`localhost` PROCEDURE `site_create_booking`(
        IN in_id_user INTEGER(11),
        IN in_id_operator INTEGER(11),
        IN in_id_yacht_operator_local INTEGER(11),
        IN in_date_from DATETIME,
        IN in_date_to DATETIME,
        IN in_id_operator_booking INTEGER(11)
    )
BEGIN

INSERT INTO 
  `t_book_request`
(
  `id_user`,
  `id_operator`,
  `id_yacht_operator_local`,
  `date_from`,
  `date_to`,
  `when_request`,
  `id_status`,
  `id_operator_booking`
) 
VALUE (
  in_id_user,
  in_id_operator,
  in_id_yacht_operator_local,
  in_date_from,
  in_date_to,
  now(),
  1,
  in_id_operator_booking
);

SELECT LAST_INSERT_ID();

INSERT INTO 
  `t_book_request_history`
(
  `id_booking`,
  `id_user`,
  `id_operator`,
  `id_yacht_operator_local`,
  `date_from`,
  `date_to`,
  `when_request`,
  `id_status`,
  `id_operator_booking`
) 
VALUE (
  LAST_INSERT_ID(),
  in_id_user,
  in_id_operator,
  in_id_yacht_operator_local,
  in_date_from,
  in_date_to,
  now(),
  1,
  in_id_operator_booking
);

END ;;
