CREATE DEFINER=`root`@`localhost` PROCEDURE `site_get_many_boats`(
        IN in_id_operator INTEGER(11),
        IN in_local_operator_ids TEXT
    )
BEGIN
declare pos INT;
drop table if exists tmp_boats_ids;
drop table if exists tmp_boats_ids2;
drop table if exists tmp_boats_ids3;
CREATE temporary TABLE `tmp_boats_ids` (
  `id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=Heap;
CREATE temporary TABLE `tmp_boats_ids2` (
  `id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=Heap;
CREATE temporary TABLE `tmp_boats_ids3` (
  `id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=Heap;
set pos=1;
while pos>0 do
	insert into tmp_boats_ids(id)
    value(substring_index(in_local_operator_ids, ',', 1));
    set pos = INSTR(in_local_operator_ids, ',');

    set in_local_operator_ids = substring(in_local_operator_ids, pos+1);

end while;
	insert into tmp_boats_ids2 select * from tmp_boats_ids;
	insert into tmp_boats_ids3 select * from tmp_boats_ids;

	select `t_boats`.`local_operator_id`, `t_site_boat_settings`.`name`, `t_boat_settings`.`value`
    from `t_boats` 
    			join tmp_boats_ids on tmp_boats_ids.id = `t_boats`.`local_operator_id`
				left join `t_site_boat_settings` on `t_site_boat_settings`.`level` = 1
                join `t_site_boat_settings_mapper` on `t_site_boat_settings_mapper`.`id_operator` = in_id_operator
                											and `t_site_boat_settings_mapper`.`id_site_boat_settings` = `t_site_boat_settings`.`id`
                                                            and `t_site_boat_settings_mapper`.`from_where` = 1
    			left join `t_boat_settings` on `t_boat_settings`.`id_operator` = in_id_operator
                							and `t_boat_settings`.`local_operator_id` = `t_boats`.`local_operator_id`
                                            and `t_boat_settings`.`name` = `t_site_boat_settings_mapper`.`operator_name`
    where `t_boats`.`id_operator` = in_id_operator
    
    UNION 
    
  	select `t_boats`.`local_operator_id`, `t_site_boat_settings`.`name`, `t_boat_model_settings`.`value`
    from `t_boats` 
    			join tmp_boats_ids2 on tmp_boats_ids2.id = `t_boats`.`local_operator_id`
				left join `t_site_boat_settings` on `t_site_boat_settings`.`level` = 1
                join `t_site_boat_settings_mapper` on `t_site_boat_settings_mapper`.`id_operator` = in_id_operator
                											and `t_site_boat_settings_mapper`.`id_site_boat_settings` = `t_site_boat_settings`.`id`
                                                            and `t_site_boat_settings_mapper`.`from_where` = 2
    			left join `t_boat_model_settings` on `t_boat_model_settings`.`id_operator` = in_id_operator
                									and `t_boat_model_settings`.`local_operator_id` = `t_boats`.`local_operator_model_id`
                                                    and `t_boat_model_settings`.`name` = `t_site_boat_settings_mapper`.`operator_name`
    where `t_boats`.`id_operator` = in_id_operator
    
    union 
-- выводится 1 строка потому что UNION делает DISTINCT    
    (select `t_boat_images`.`local_operator_id`, case `t_boat_images`.`type` when '0' then 'Main Photo' when '1' then 'Photo' when '2' then 'Ext Photo' end, `t_boat_images`.`local_url`
    from `t_boat_images` join tmp_boats_ids3 on `t_boat_images`.`local_operator_id` = tmp_boats_ids3.id
    where `t_boat_images`.`id_operator` = in_id_operator);

   
drop table tmp_boats_ids;
drop table tmp_boats_ids2;
drop table tmp_boats_ids3;
END ;;
DELIMITER ;
