CREATE DEFINER=`root`@`localhost` PROCEDURE `site_get_places`(
        IN in_text VARCHAR(63)
    )
BEGIN
	select `t_places`.`id`, `t_places`.`name`, `t_places`.`id_level`, `t_place_levels`.`name`, count(*) as cnt
    from `t_places` left join `t_boat_ports` on `t_boat_ports`.`id_place` = `t_places`.`id`
    		left join `t_place_levels` on `t_place_levels`.`id` = `t_places`.`id_level`
    where `t_places`.`name` like concat(in_text, '%')
    group by `t_places`.`id`
    order by cnt desc
    limit 10;
END ;;
