CREATE DEFINER=`root`@`localhost` PROCEDURE `site_map_places`(
        IN in_place_ids TEXT
    )
BEGIN
declare pos INT;
drop table if exists tmp_place_ids;
CREATE temporary TABLE `tmp_place_ids` (
  `id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=Heap;
set pos=1;
while pos>0 do
	insert into tmp_place_ids(id)
    value(substring_index(in_place_ids, ',', 1));
    set pos = INSTR(in_place_ids, ',');

    set in_place_ids = substring(in_place_ids, pos+1);

end while;

SELECT 
  `id_place`,
  `id_operator`,
  `id_level`,
  `local_operator_id`
FROM 
  `t_operator_place_mapper` join tmp_place_ids on (tmp_place_ids.id = `t_operator_place_mapper`.`id_place`)
WHERE `t_operator_place_mapper`.`is_exist` = 1;
   
drop table tmp_place_ids;
END ;;
DELIMITER ;
