CREATE DEFINER=`root`@`localhost` PROCEDURE `site_register_client`(
        IN in_email VARCHAR(255),
        IN in_password VARCHAR(63),
        IN in_first_name VARCHAR(127),
        IN in_second_name VARCHAR(127)
    )
BEGIN
if (select count(*) from t_user where `t_user`.`email` = in_email) then
	select -1;
else
INSERT INTO 
  `t_user`
(
  `email`,
  `password`,
  `first_name`,
  `second_name`
) 
VALUE (
  in_email,
  in_password,
  in_first_name,
  in_second_name
);
select LAST_INSERT_ID();
end if;
END ;;
